import React, {Component} from 'react';
import "bootstrap/dist/css/bootstrap.min.css";

export default class CreateTodo extends Component {

    constructor(props) {
        super(props);

        this.onChangeEtat = this.onChangeEtat.bind(this);
        this.onChangeNom = this.onChangeNom.bind(this);
        
        this.onSubmit = this.onSubmit.bind(this);

        this.state = {
            etat: '',
            nom: '',
           
        }
    }

    onChangeEtat(e) {
        this.setState({
            etat: e.target.value
        });
    }

    onChangeNom(e) {
        this.setState({
            nom: e.target.value
        });
    }

   

    onSubmit(e) {
        e.preventDefault();

        console.log(`Form submitted:`);
        console.log(`Nom: ${this.state.etat}`);
        console.log(`Etat: ${this.state.nom}`);

        this.setState({
            etat: '',
            nom: '',
            
        })
    }

    render() {
        return (

          
            <div className="container col-md-12 text-center " style={{marginTop: 20}}>
                <h3>Créer une enchère</h3>
                <form onSubmit={this.onSubmit} >

                    <div class="form-group text-blue col-md-12">
                        <label>Etat: </label>
                        <input  type="text"
                                className="form-control"
                                value={this.state.etat}
                                onChange={this.onChangeEtat}
                                width = "100%"
                                marginTop="2"
                                />
                    </div>
                    <div class="form-group text-blue col-md-3">
                        <label>Nom: </label>
                        <input  type="text"
                                className="form-control"
                                value={this.state.nom}
                                onChange={this.onChangeNom}
                                />
                    </div>
                    
                   
                    <div className="form-group">
                        <input type="submit" value="Valider la création" className="btn btn-primary" />
                    </div>
                </form>
            </div>

            
        )
    }
}
